import { useState } from "react";
import "./App.css";
import TodoList from "./TodoList";
import TodoForm from "./TodoForm";
import TodoFooter from "./TodoFooter";

function App() {
  const [todos, setTodos] = useState([
    {
      id: Math.random(),
      text: "Learn JS",
      isComplated: false,
    },
    {
      id: Math.random(),
      text: "Learn React",
      isComplated: false,
    },
    {
      id: Math.random(),
      text: "Learn English",
      isComplated: false,
    },
  ]);

  return (
    <div className="App">
      <TodoForm
        onAdd={(text) =>
          setTodos([
            ...todos,
            {
              id: Math.random(),
              text: text,
              isComplated: false,
            },
          ])
        }
      />
      <TodoList todos={todos} />
      <TodoFooter todos={todos} />
    </div>
  );
}

export default App;
